import React from "react";
import HeadCell from "./HeadCell/index";

const TableHead = ({ matrix }) => {
   const matrixHeads = matrix.map((item, index) => {
      return <HeadCell key={index} value={"col " + (index + 1)} />;
   });
   let heads = [<HeadCell value="" />, <HeadCell value={"Sum"} />];
   heads.splice(1).shift(matrixHeads);
   console.log(heads)

   return (
      <thead>
         <tr>{heads}</tr>
      </thead>
   );
};

export default TableHead;
